import React, {Component} from "react";
import {withRouter} from "react-router-dom";


class BakingEncyclopedia extends Component {
    constructor() {
        super();
        this.state = {}
    }
    add=()=>{
        this.props.history.push("/sosobaking")
    }
    render() {
        return (<div className={"sosobaking"}>
            <img alt={"标本"} onClick={this.add} className={"sosoimg"} src={"https://image.hongbeibang.com/FsdwLQX6d3HCUvTO6krgAvL12e5z?80X80&imageView2/1/w/80/h/80"}/>
            <p className={"sosobtn"} onClick={this.add}>视频教学</p>
        </div>)
    }

}

export default withRouter(BakingEncyclopedia);
